---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: kaneo-secrets
  namespace: kaneo
spec:
  encryptedData:
    auth-secret: 
    database-url: 
    postgres-password: 
    postgres-user: 
  template:
    metadata:
      name: kaneo-secrets
      namespace: kaneo
    type: Opaque
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: kaneo-github-secrets
  namespace: kaneo
spec:
  encryptedData:
    github-app-id: 
    github-client-id: 
    github-client-secret: 
    github-private-key: 
    github-webhook-secret: 
  template:
    metadata:
      name: kaneo-github-secrets
      namespace: kaneo
    type: Opaque
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: kaneo-google-secrets
  namespace: kaneo
spec:
  encryptedData:
    google-client-id: 
    google-client-secret: 
  template:
    metadata:
      name: kaneo-google-secrets
      namespace: kaneo
    type: Opaque
